import React from 'react'
import { Carousel } from 'react-responsive-carousel'
import 'react-responsive-carousel/lib/styles/carousel.min.css'

export default function Slider() {
  const slides = [
    {
      src: 'https://images.unsplash.com/photo-1498050108023-c5249f4df085?auto=format&fit=crop&w=1350&q=80',
      alt: 'Modern IT Office',
    },
    {
      src: 'https://images.unsplash.com/photo-1581093588401-03040e5d5bbf?auto=format&fit=crop&w=1350&q=80',
      alt: 'Laptop and Code Interface',
    },
    {
      src: 'https://images.unsplash.com/photo-1603980365870-004e83e5d29f?auto=format&fit=crop&w=1350&q=80',
      alt: 'IT Branding and Digital Workspace',
    },
  ]

  return (
    <div className="w-full max-w-4xl mx-auto rounded-lg overflow-hidden shadow-lg">
      <Carousel
        showThumbs={false}
        autoPlay
        infiniteLoop
        showStatus={false}
        showArrows={false}
        interval={2000}
      >
        {slides.map((slide, index) => (
          <div key={index}>
            <img
              src={slide.src}
              alt={slide.alt}
              className="object-cover w-full h-96"
            />
          </div>
        ))}
      </Carousel>
    </div>
  )
}
